message: "Rolex Submariner,  представленная в 1953 году  стала  первой дайверской моделью, выдерживающими глубину до 100 метров . \r\n Модель имеет вращающийся безель ,  Triplock-заводную головку, обеспечивающие  безопасность даже в экстремальных условиях. \r\nДизайн  включает хромалитовый циферблат ,  стальной корпус Oystersteel, подчеркивающие функциональность . \r\n<a href=\"https://rolex-submariner-shop.ru\">rolex-submariner-shop.ru</a> \r\n Автоподзавод до 70 часов  сочетается с  перманентной работой, что делает их надежным спутником  для активного образа жизни. \r\n За десятилетия Submariner стал  символом часового искусства, оцениваемым как  эксперты."
